        --uib-speed: ${this.speed}s;
      }
      ${styles}
    `;
    }
}
export default {
    register: (name = 'l-quantum') => {
        if (!customElements.get(name)) {
            customElements.define(name, class extends Quantum {
            });
        }
    },
    element: Quantum,
};
